
CREATE VIEW [Premiacao].[vw_PremiacaoCorrespondente_Teste] 
WITH SCHEMABINDING
AS

SELECT
 PC.ID,
 C.Matricula, 
 C.CPFCNPJ, 
 C.Nome, 
 U.Codigo [AgenciaVinculoCorrespondente], 
 C.Cidade, 
 C.UF, 
 CDB.Banco, 
 CDB.Agencia [AgenciaConta], 
 CDB.ContaCorrente, 
 CDB.Operacao,
 C.IDTipoCorrespondente,
 --TP.Descricao,
 PC.IDTipoProduto, 
 PC.ValorCorretagem, 
 PC.DataCompetencia, 
 PC.LoteImportacaoPROTHEUS,
 PC.ItemImportacaoPROTHEUS, 
 PC.DataProcessamento,
 PC.[Status]
FROM Dados.RePremiacaoCorrespondente PC
INNER JOIN Dados.Correspondente C
ON C.ID = PC.IDCorrespondente
LEFT JOIN Dados.CorrespondenteDadosBancarios CDB
ON CDB.IDCorrespondente = PC.IDCorrespondente
AND CDB.IDTipoProduto = PC.IDTipoProduto
INNER JOIN Dados.TipoProduto TP
ON TP.ID = PC.IDTipoProduto
LEFT JOIN Dados.Unidade U
ON U.ID = C.IDUnidade 
OUTER APPLY (SELECT TOP 1 Validacao FROM Dados.[fn_validaCPF_CNPJ](C.CPFCNPJ) V ) V 
WHERE   
  --    C.Nome <> '' AND C.Nome IS NOT NULL
  --AND C.CPFCNPJ <> '' AND C.CPFCNPJ IS NOT NULL
     ----------AND (CASE WHEN C.IDUnidade IS NOT NULL AND PC.IDTipoProduto = 1 THEN 1 
     ----------          WHEN PC.IDTipoProduto = 2 THEN 1
	 ----------  ELSE 0 
	 ----------  END) = 1 --Removido a pedido do Marcus Teixeira em 12/05/2014
  --AND (CDB.ContaCorrente <> '' AND CDB.ContaCorrente IS NOT NULL)
--  AND 
  V.Validacao = 'Inválido'
  AND 
  PC.ID NOT BETWEEN  90188 AND 90379 --Ouvidoria CEF (Pagamento retroativo 21/09/2015)
  --and pc.DataCompetencia = '2015-08-01'
  --and pc.IDTipoProduto = 1
  --and c.IDTipoCorrespondente =1


  --and arquivo <> 'CORREÇÃO MANUAL OUVIDORIA CEF - 2015-09-21'

